arcpy.env.overwriteOutput = True

#Setting workspace

arcpy.env.workspace = GDB
 
#Input file for forest area in GCS WGS84
forest = arcpy.GetParameterAsText(0)

#UTM Zone Shapefiles in GCS WGS84

fldJoin = arcpy.GetParameterAsText(1)
unit = arcpy.GetParameterAsText(2)
zone = "UTM_Indo"

#Projection variable definition




#Intersect forest area with UTM Zone
forest_zone=arcpy.Intersect_analysis([forest,zone],"forest_zone","ALL","","INPUT")

#Field name with EPSG Code for each zone
fldName="KODE"

#Convert intersect Feature Class to FeatureLayer
flayer=arcpy.MakeFeatureLayer_management("forest_zone","forest_zone_layer")

#Forest zone(Feature Layer)
fcName="forest_zone_layer"

#Create List
myList = set([row.getValue(fldName) for row in arcpy.SearchCursor(fcName)])

#Data management

if unit == 'Square meters':
	for code in myList:
		#Select UTM Code
		arcpy.SelectLayerByAttribute_management(fcName,"NEW_SELECTION","KODE='"+code+"'")
		#Save selected row as new layer based on UTM Code
		arcpy.CopyFeatures_management(fcName,fcName+"_"+ code)
		#Transform projection and change fcName_code to fcName_code_utm
		kode = int(code)
		sr = arcpy.SpatialReference(kode)
		arcpy.Project_management(fcName + "_" + code, fcName+ "_"+code+"_utm", sr)
		#Add new column M2 (area)
		arcpy.AddField_management(fcName+"_"+ code +"_utm","M2","DOUBLE")
		#Add new column M (length)
		arcpy.AddField_management(fcName+"_"+code+"_utm","M","DOUBLE")
		geometryField=arcpy.Describe(fcName+"_"+code+"_utm").shapeFieldName
		cursor=arcpy.UpdateCursor(fcName+"_"+code+"_utm")
		for row in cursor:
			AreaValue = row.getValue(geometryField).area
			LenValue = row.getValue(geometryField).length
			row.setValue("M2",AreaValue)
			row.setValue("M",LenValue)        
			cursor.updateRow(row)		
		del row, cursor
	#Merge shapefiles
	fcs = arcpy.ListFeatureClasses('*_utm')
	arcpy.Merge_management(fcs,"forest_zone_layer_utm_merge")
	#Add column SUM_LUAS to forest_zone_layer_utm_merge
	arcpy.AddField_management("forest_zone_layer_utm_merge","SUM_M2","DOUBLE")
	#Add column SUM_LEN to forest_zone_layer_utm_merge
	arcpy.AddField_management("forest_zone_layer_utm_merge","SUM_M","DOUBLE")
	#Calculate Area
	arcpy.Statistics_analysis("forest_zone_layer_utm_merge","forest_zone_layer_utm_merge_sum","M2 SUM",fldJoin)
	#Join table for calculation area result
	arcpy.JoinField_management(forest,fldJoin,"forest_zone_layer_utm_merge_sum",fldJoin,"SUM_M2")
	#Calculate Length
	arcpy.Statistics_analysis("forest_zone_layer_utm_merge","forest_zone_layer_utm_merge_sum","M SUM",fldJoin)
	#Join table for calculation length result
	arcpy.JoinField_management(forest,fldJoin,"forest_zone_layer_utm_merge_sum",fldJoin,"SUM_M")		
elif unit == 'Square kilometers':
	for code in myList:
		#Select UTM Code
		arcpy.SelectLayerByAttribute_management(fcName,"NEW_SELECTION","KODE='"+code+"'")
		#Save selected row as new layer based on UTM Code
